import React,{useState} from 'react';
import { Logo } from '../../Styles/Forms.styled';
import { ContentAndItems, ContentPart, VerifiedUserHeader,ControlFlex, VerifiedUserHeaderContent,VerifiedUserHeaderSection, VerifiedUserHeaderSection1 } from '../../Styles/LandingPage.styled';
import {CloseOutlined, DownOutlined, ExpandOutlined, SearchOutlined, UserSwitchOutlined,UsergroupAddOutlined, WechatOutlined, RiseOutlined, FileSearchOutlined} from '@ant-design/icons'
import { DomainNameContainer, SecondSection,ListItem, DropDown } from '../../Styles/Header.styled';
import {Link} from 'react-router-dom';
import { useDispatch, useSelector } from 'react-redux';
import { logoutInitiate } from '../../redux/action';


function Header(){
  const [isOpen,setIsOpen]=useState(false)
  const [userName,setUserName]=useState('')

  const {currentUser} =useSelector((state)=>state.user)
  const dispatch = useDispatch();

  const handleAuth=()=>{
     if(currentUser){
      dispatch(logoutInitiate())
     }
  }

  const toggleDown=()=>setIsOpen(!isOpen);

    const over=()=>{
        document.querySelector('.content').style.display="block";
        document.querySelector('.arrow').classList.add('trans');
      };

      const out=()=>{
      document.querySelector('.content').style.display=""
      document.querySelector('.arrow').classList.remove('trans');
      document.querySelector('.arrow').classList.add('')
      }




    return(
     <React.Fragment>

     <VerifiedUserHeader>

        <VerifiedUserHeaderContent>
          <Link to="/verified"><Logo src="./images/amalitech.png" alt="annex"  className="header_logo"/> </Link> 


             <VerifiedUserHeaderSection1 >
            <SecondSection left={50} onMouseEnter={over}>
            <li>Perform Query</li>
            <DownOutlined  className='arrow'/>
            </SecondSection>

            <SecondSection onMouseEnter={out}>
            <Link to="/help"><li>Help</li></Link>
            {/* <DownOutlined className='arrow'/> */}
            </SecondSection>

         </VerifiedUserHeaderSection1>

         <VerifiedUserHeaderSection>
        <Logo src="./images/avatar.png" alt="profile" onClick={toggleDown} />  
           <h3>{currentUser?.displayName}</h3>


           </VerifiedUserHeaderSection>

        </VerifiedUserHeaderContent>
    </VerifiedUserHeader>

       <ContentAndItems className="content"  onMouseLeave={out}>
          <ContentPart left={25} top={1.5}>
            <ControlFlex>
           <Link to="/domain" style={{color:'#fff',textDecoration:'none'}}><li>Domain Name</li></Link> 
            <SearchOutlined  style={{position:'relative',top:'0.3rem',left:'0.5rem'}}/>
            </ControlFlex>

            <ControlFlex>
            <Link to="/find-email" style={{color:'#fff',textDecoration:'none'}}><li>Email Finder</li></Link>
            <ExpandOutlined style={{position:'relative',top:'0.3rem',left:'0.5rem'}}/>
            </ControlFlex>

            <ControlFlex>
            <Link to="/author" style={{color:'#fff',textDecoration:'none'}}><li>Author Finder</li></Link>
              <UsergroupAddOutlined style={{position:'relative',top:'0.3rem',left:'0.5rem'}}/>
             </ControlFlex>
          </ContentPart>
          <ContentPart left={45} top={-2}>
            <ControlFlex>
            <Link to="/verify-email" style={{color:'#fff',textDecoration:'none'}}> <li>Email Verifier</li></Link>
            <FileSearchOutlined style={{position:'relative',top:'0.3rem',left:'0.5rem'}}/>
            </ControlFlex>

            <ControlFlex>
            < Link to="/count" style={{color:'#fff',textDecoration:'none'}}><li>Email Count</li></Link>
            <RiseOutlined style={{position:'relative',top:'0.3rem',left:'0.5rem'}}/>
            </ControlFlex>
          </ContentPart>

        <CloseOutlined  onClick={out} style={{fontSize:'30px',position:'relative',top:'-2.6em',left:'43em'}}/>
       </ContentAndItems>


       {isOpen &&(
             <Link to="/">
             <DropDown onClick={handleAuth}>
               <p>Logout</p>
            </DropDown>
            </Link>

          )}

    </React.Fragment>

    )
}


export default Header
